import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from "./components/app";

class WhoAmI extends Component {
    constructor(props) {
        super(props);
        this.state = {
          years: 26
        }
    }

    render () {
        const { name, link } = this.props;
        const { years } = this.state;
        return (
            <>
             <WhoAmI name={ name } link={ link } years={ years }/>
             {/*<WhoAmI name={this.props.name} link={this.props.link} years={ this.state.years }/>*/}
            </>
        )
    }
}


